     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "We see that most of the user activity captured in the data is in either North America or Europe. The regression model predicting the number of Pokemon will thereby heavily depends on the continent. **Including the continent as a factor regressor, however, would be somewhat misleading. This is because although the data didnot captured as many the user activities as in North America or Europe, it is reasonable to assume there should be unseen Pokemons. So, I think it is reasonable to include the continent as a random effects.**"
   ]
  },
