     "start_time": "2023-01-29T08:35:42.583499",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "Since it is unrealistic to have distances to Pokemon gym more than 5km, I would drop such observations. Likewise, I would drop observations with distance to pokestop over 5km. It is quite well known fact that some players in Pokemon Go use fake GPS or even drones to play the game without having to walk around their neighbors. The game is not designed for this and the data with distances from Pokestop and Gym over 5Km is quite likely from those cheaters. So, I think it is reasonable to drop such observations."
   ]
  },
