   "source": [
    "More than 23k observations has the exactly same distance to gym and Pokestop, and the data were all collected in 2016. Although it is now allowed to host Pokestop at gym by an update in 2017, when data were collected in 2016, it wasn't. So, we can filter these observations out. For more information, please see Niantic press release at June 19, 2017: https://nianticlabs.com/en/press/2017/raids"
   ]
