   "source": [
    "As you can find in the article https://pokemondb.net/evolution#evo-g1, each Gen 1 Pokémon can have up to 3 different evolving forms, (Pokémon # from 1 to 151, excluding any regional forms, such as Aloan or Galarian). For example, Bulbasaur can have 3 different evolving forms: Bulbasaur-Ivysaur-Venusaur.\n",
    "\n",
    "In pokedex dataset from All Pokemon, variable Final Evolution can take Boolean value: if the Pokémon is in its final evolution form then 1, if not then 0. \n",
    "\n",
    "So, I created a new variable named _Evolution_, with starting value 1 + Final Evolution. Then, giving 2 conditions, **if Evolution value is equal to that of next row** and **if Final Evolution is 0**, then change the Evolution value to 0. Otherwise, just leave it."
   ]
  },
