   "source": [
    "Above is the Pokédex. The dataset contains information about each Pokémon. The variable **Experience type** is a factor variable with 4 levels. It groups Pokémon by the amount of experience point the Pokémon needs to level up to 100. The variable **BST** marks the sum of the base stats constituting Combat Power of each Pokémon. \n",
    "\n",
    "**Catch Rate** measures how likely to catch a wild Pokémon, when a player throw a Poké Ball to the Pokémon, Pokémon Go uses Pokémon's catch rate as well as other conditions to determine the chances of catching a Pokémon. Higher catch rates mean that the Pokémon is easier to catch, *up to a maximum of 255*. For more information: https://bulbapedia.bulbagarden.net/wiki/Catch_rate\n",
    "\n",
    "I dropped Final Evolution, as the infomation is all contained in the new varaible Evolution."
   ]
  },
