   "source": [
    "pokemon_data <- data %>%\n",
    "  dplyr::select(continent, pokemonId, temperature, windSpeed, pokestopDistanceKm, gymDistanceKm) %>%\n",
    "  group_by(continent, pokemonId) %>%\n",
    "  summarise(count = n(), \n",
    "            med.temp = median(temperature, na.rm = T), \n",
    "            med.windSpeed = median(windSpeed, na.rm = T),\n",
    "            med.pokestop = median(pokestopDistanceKm, na.rm = T),\n",
    "            med.gymDist = median(gymDistanceKm, na.rm = T)) %>%\n",
    "  drop_na()"
   ]
  },
