   "source": [
    "I summarized the cleaned row data *300k* by Continent and Pokemon ID. As mentioned above, there are some skewness of the distances from gym and pokestop. So, I decided to use median values to summarize the variables. Likewise, since there are some skewness in the wind speed, I would take median for the variable as well. \n",
    "\n",
    "Although average can be a good summarization for the temperature, since the temperature variable is quite symmetric, I think it doesn't matter using either median or mean value. So, to make interpretation of the final regression model easier, I also took median value for the temperature."
   ]
